	user_status varchar(30) NULL,
	user_validation varchar(255) NULL,
	user_welcome json NULL,
	person_id varchar(30) NOT NULL,
	app_id varchar(30) NOT NULL,
	event_id varchar(30) NOT NULL,
	process_id varchar(30) NOT NULL,
	time_started timestamptz NOT NULL DEFAULT now(),
	time_updated timestamptz NOT NULL DEFAULT now(),
	time_finished timestamptz NOT NULL DEFAULT now(),
	active int4 NOT NULL DEFAULT 1,
	CONSTRAINT users_user_alias_key UNIQUE (user_alias),
	CONSTRAINT users_user_id_key UNIQUE (user_id),
	CONSTRAINT users_person_id_fkey FOREIGN KEY (person_id) REFERENCES persons(person_id)
);

